import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Brimstone Valley Draft AI</h1>
        <p>
          Pick some Heroes!
        </p>
        <p>heroes list...</p>

      </header>
      <footer>
      <a
          className="App-link"
          href="https://brimstonevalley.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Play Brimstone Valley
        </a>
      </footer>
    </div>
  );
}

export default App;
